let searchBySearch_row_text = (state_copy) => {
    state_copy.search_info.search_items_data.length = 0
    let index_to_delete = []
    let re = /[ ,-.|\\=+_[\]{}()<>?/'":;*&^%$#@!~`]/
    let arrayOfWordsToSearchBy = state_copy.search_info.search_row_text.toUpperCase().split(re)
    arrayOfWordsToSearchBy.forEach((element, i, m) => {
        if (element === '' || (!isNaN(element)) || element === 'GB')
            index_to_delete.push(i)
    })
    index_to_delete.sort((a, b) => b - a)
    index_to_delete.forEach(el => arrayOfWordsToSearchBy.splice(el, 1))

    arrayOfWordsToSearchBy.forEach((el) => {
        state_copy.items_data.forEach((element) => {
            if (element.item_name.toUpperCase().indexOf(el) !== -1 && state_copy.search_info.search_items_data.indexOf(element) === -1)
                state_copy.search_info.search_items_data.push(element)
        })
    })
}

let optionsOrder = (state_copy) => {
    if (!state_copy.search_info.previous_searches.includes(state_copy.search_info.search_row_text)) {
        if (state_copy.search_info.previous_searches.length >= 5) state_copy.search_info.previous_searches.length = 4
    } else {
        let index = state_copy.search_info.previous_searches.indexOf(state_copy.search_info.search_row_text)
        state_copy.search_info.previous_searches.splice(index)
    }
    state_copy.search_info.previous_searches.unshift(state_copy.search_info.search_row_text)
}

const itemsAndSearchReducer = (state = items_and_search, action) => {
    switch (action.type) {
        case INCREASE_ITEM_VIEWS: {
            let index
            state.items_data.forEach((el, i) => {
                if (el.id === action.id) index = i
            })
            let state_copy = {
                ...state,
                items_data: [
                    ...state.items_data
                ]
            }
            state_copy.items_data[index] = {...state.items_data[index]}
            state_copy.items_data[index].views_count++
            return state_copy
        }
        case SEARCH_ROW_TEXT_CHANGE: {
            let state_copy = {
                ...state,
                search_info: {
                    ...state.search_info,
                    previous_searches: [...state.search_info.previous_searches],
                    search_items_data: [...state.search_info.search_items_data],
                    search_row_text: action.text
                }
            }

            searchBySearch_row_text(state_copy)

            return state_copy
        }
        case ON_SEARCH: {
            let state_copy = {
                ...state,
                search_info: {
                    ...state.search_info,
                    previous_searches: [...state.search_info.previous_searches]
                }
            }
            optionsOrder(state_copy)
            return state_copy
        }
        case SET_PHONES: {
            const items = require("./../mobile_parser/phones.json");
            let state_copy = {
                ...state,
                items_data: items
            }
            return state_copy
        }
        default:
            return state
    }
}

export const increaseItemViewsAC = (id) => ({type: INCREASE_ITEM_VIEWS, id: id})
export const onSearchAC = () => ({type: ON_SEARCH})
export const setPhoneshAC = () => ({type: SET_PHONES})
export const searchRowTextChangeActionCreator = (text) => ({type: SEARCH_ROW_TEXT_CHANGE, text: text})

export default itemsAndSearchReducer